import React from 'react'
import {Container, Row, Col} from 'react-bootstrap'
import SkillsCard from '../components/Design/SkillsCard'

const Skills = () => {

    return(
        <div >
            <Container style={styles.screenContainer}>
                <SkillsCard />
            </Container>
        </div>
    )

}
const styles = {
    screenContainer: {
        paddingTop: '4em',
        paddingBottom: '10em',
    },
}

export default Skills;
